<p>N&amp;D PUMPKIN &ndash; давно знакомая нам линейка без злаков, с 96% содержанием белка и тыквой. Тыква богата антиоксидантами и растворимыми волокнами, которые помогают усваиваться питательным веществам. А также тыква предлагает альтернативные источники животного белка, отличные от используемых в N&amp;D PRIME.<br />Отличное решение для всех пород и размеров.</p>
