<p><strong>Ингредиенты:</strong></p>
<p>Свежее мясо ягненка (24%), дегидратированное мясо ягненка (24%), гороховый крахмал (20%), куриный жир, гидролизат белка рыбы, дегидратированная тыква (5%), свежая сельдь, дегидратированная сельдь, дегидратированные цельные яйца, рыбий жир, волокна гороха, морковь, сушеная люцерна, инулин, фруктоолигосахариды, маннанолигосахариды, дегидратированный сладкий апельсин (0,5%), сушеные яблоки, порошок граната, порошок шпината, подорожник (0,3%), порошок черной смородины, порошок черники, хлорид натрия, дрожжи сухие пивные, корень куркумы (0,2%), глюкозамин, хондроитин сульфат, календулы экстракт (источник лютеина).</p>
<p><strong>Пищевые добавки на кг: </strong>Витамин А 16000МЕ; Витамин D3 1600МЕ; Витамин Е 600мг; Витамин С 160мг; Ниацин 40мг; Пантотеновая кислота 16мг; Витамин В2 8мг; Витамин В6 6,4мг; Витамин В1 4,8мг; Витамин Н 0,40мг; Фолиевая кислота 0,48мг; Витамин В12 0,1мг; хлорид холина 2800мг; Бета-каротин 1,5мг; цинка хелат аналогичный метионин гидроксилазе 910мг; марганца хелат аналогичный метионин гидроксилазе 380мг; железа хелат глицин гидрат 250мг; меди хелат аналогичный метионин гидроксилазе 88мг; селенометионин 0,40мг; DL-метионин 6000мг; Таурин 1000мг; L-карнитин 300мг.<br />Специальные добавки:<br />экстракт алоэ вера 1000мг; экстракт зеленого чая 100мг; экстракт розмарина. Антиоксиданты: экстракт токоферолов натурального происхождения.</p>
<p><strong>Питательные вещества: </strong>сырой протеин 35,00%, сырой жир и масла 20,00%, сырая клетчатка 1,90%, сырая зола&nbsp;8,10%, Кальций 1,30%, Фосфор 0,90%, Омега‐6 3,40%, Омега‐3 0,90%, DHA 0,50%, EPA&nbsp;0,30%, Глюкозамин 1400мг/кг, Хондроитин 1100мг/кг</p>
